                            <button type="submit" onClick={()=>{Cheackuser()}} >Login</button>
                        </div>
                    </from>
                    <div className='link'>
                        <Link to='#'>
                            <a>Sing in</a>
                        </Link>
                    </div>
                </div>
            </section>
            
        </div>
    )
}

export default UserLogin
